import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (

    <Routes>
      <Route path="/" element = {<Home/>}/>
      <Route path="signup" element = {<SignUp/>}/>
      <Route path="signin" element = {<SignIn/>}/>

    </Routes>


  );
}

export default App;
